using TravelAgency.Shared.Dto;
using TravelAgency.Shared.Travel;

namespace TravelAgency.Shared.Airports
{
    public class AirportsList
    {
        public static Airport GetNearestAirport(GeoCoordinatesDto coordinates)
        {
            Airport? nearestAirport = null;
            double minDistance = double.MaxValue;

            foreach (var airport in Airports)
            {
                double distance = CalculateDistance(coordinates, airport.GeoCoordinates);
                if (distance < minDistance)
                {
                    minDistance = distance;
                    nearestAirport = airport;
                }
            }

            return nearestAirport ?? Airports.First();
        }

        private static double CalculateDistance(GeoCoordinatesDto coordinates1, GeoCoordinatesDto coordinates2)
        {
            double lat1 = coordinates1.Latitude;
            double lon1 = coordinates1.Longitude;
            double lat2 = coordinates2.Latitude;
            double lon2 = coordinates2.Longitude;

            double earthRadius = 6371;

            double dLat = DegreesToRadians(lat2 - lat1);
            double dLon = DegreesToRadians(lon2 - lon1);

            double a = Math.Sin(dLat / 2) * Math.Sin(dLat / 2) +
                       Math.Cos(DegreesToRadians(lat1)) * Math.Cos(DegreesToRadians(lat2)) *
                       Math.Sin(dLon / 2) * Math.Sin(dLon / 2);
            double c = 2 * Math.Atan2(Math.Sqrt(a), Math.Sqrt(1 - a));

            double distance = earthRadius * c;
            return distance;
        }

        private static double DegreesToRadians(double degrees)
        {
            return degrees * Math.PI / 180;
        }

        public static int CalculateFlightTravelTime(Airport sourceAirport, Airport targetAirport)
        {
            double airspeed = 15;

            double distance = CalculateDistance(sourceAirport.GeoCoordinates, targetAirport.GeoCoordinates);
            double travelTime = distance / airspeed;

            int travelTimeMinutes = (int)(travelTime * 60);

            return travelTimeMinutes;
        }

